                            id="h-intro-jenny-txt-wrap">
                            <div class="h-intro-jenny-txt-wrap oh">
                                <p class="h-intro-jenny-txt"><span id="h-intro-jenny-txt-spe">I’M A DIGITAL DESIGNER&nbsp;</span>&nbsp;from Sweden living in San Francisco, where I work as a Senior Designer at Ueno. With a background in advertising, my strength lies in website and
                                    app design.</p>
                            </div>
                            <div class="h-intro-jenny-txt-wrap oh">
                                <p id="h-intro-jenny-txt-last" class="h-intro-jenny-txt">If you want to know more about me, my work or if youʼre a Nigerian prince who wants to offer me a lot of money, feel free to contact me on hi[at]jennyjohannesson.com.</p>
                            </div>
